import React from 'react';
import './App.css';
import Header from './Header';

function Cases(props) {
  const numbers = props.numbers;
  const listItems = numbers.map((number) =>
    <li>{number}</li>
  );
  return (
    <ul>{listItems}</ul>
  );
}

const numbers = [0];

function App() {
  function addCase() {
    numbers.push(numbers[-1] + 1);
    alert(numbers[-1] + 1)
  }

  return <div>
      <input type="text" placeholder='Задача...'></input>
      <button onClick={addCase}>Добавить</button>

      <Cases numbers={numbers}  />
    </div>
}

export default App;
